import React, { Component } from "react";
class test extends Component {
  constructor(props) {
    super(props);
    this.handelClick = this.handelClick.bind(this);
    this.state = {};
  }

  render() {
    return (
      <div onClick={this.handelClick}>
        <p>{this.props.content}</p>
      </div>
    );
  }
  handelClick() {
    this.props.handelDelete(this.props.index);
  }
}

export default test;
